review:
Razvan A Lupusoru: Vlad,

I am eager to see your unit test for this because I admit I fail to understand the scenario you describe. From what I gather, it seems more to me that what you are describing is an assumption made in the NCE algorithm.

This is the scenario that I believe you are talking about:

while (i < 10) {
  a.field = 1;
  a = null;
  a.field = 2;
  i++;
}

The NCE algorithm should see that the redefinition of ``a`` is a different object that also needs null checked.

Anyway, I think a test case should be enough for me to gather where the problem comes from since I am surprised that this patch caused it :)
Vladimir Marko: Reverted

This patchset was reverted in change: I41c7a03c49f7904370a64c6ececc89146ff735c8
Vladimir Marko: This is just wrong. Consider a loop where the register in null-checked at entry and becomes null later. On the first pass we'll mark the insn as null-checked and then never unmark it. (The lack of tests that would catch this is really bad.)

The correct approach is to wait until we converge and then do a final pass as we do for the GVN.
Vladimir Marko: I'm working on the NCE, see https://android-review.googlesource.com/110563 . And I'm thinking I should fix this as part of that rewrite. Let's avoid the waste of working on the same thing.
Razvan A Lupusoru: Duh! Thanks! :)
Vladimir Marko: Test submitted: https://android-review.googlesource.com/110569

We enter a loop with a null-checked register (NEW_INSTANCE is null-checked) and the NCE marks a MIR inside the loop as null-checked during the first pass because all the available inputs of a Phi were null-checked. However, on a second pass while we're processing the Phi we find an input that's not null-checked but the MIR is already marked as null-checked...
Yevgeny Y Rouban: Thank you Vladimir! I'm preparing another fix.

